import generateFakeData from './lib/fake.js'
import moment from 'moment'





gitData()

export default function App() {
    async function gitData() {
        const res = await fetch(`https://api.github.com/users/nasimreza72/repos`);
        const result = await res.json()
            .then(result => result.forEach(element => {
                let duration = moment(element.created_at, "YYYY-MM-DD").fromNow();
               return console.log(element.name, "-         -", duration);
            }))
    }
}
